export function EventViewIcon(props) {
  let boxcolor, textcolor;
  if (props.status == 'pending') {
    boxcolor = '#26CDEB';
    textcolor = '#11788A';
  } else if (props.status == 'scheduled') {
    boxcolor = '#E1AAF0';
    textcolor = '#450357';
  }
  return (
    <svg
      width="300"
      height="50"
      viewBox="0 0 173 41"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M5.80566 1.68945H164.728C169.146 1.68945 172.728 5.27117 172.728 9.68945V30.8725C172.728 35.2908 169.146 38.8726 164.728 38.8726H5.80566V1.68945Z"
        fill={boxcolor}
        fillOpacity="0.25"
      />
      <rect width="5.80599" height="40" fill={boxcolor} />
      <text
        x="70"
        y="10"
        textAnchor="middle"
        stroke="black"
        //fontWeight="lighter"
        fontSize={12}
        alignmentBaseline="middle"
      >
        {' '}
        {props.title}
      </text>
      <text
        x="90"
        y="30"
        fontSize={10}
        textAnchor="middle"
        stroke={textcolor}
        //fontWeight="lighter"
        alignmentBaseline="middle"
      >
        {' '}
        {props.course} {`${props.start} - ${props.end}`}
      </text>
    </svg>
  );
}
